import React, { useState, useEffect } from "react";
import AOS from 'aos';
import 'aos/dist/aos.css'; // Import AOS CSS for the predefined animations
import { Box, Grid, Paper, Typography,  useTheme, useMediaQuery } from "@mui/material";
import frame22 from '../assets/frame22.png'
import CustomButton from './Button/CustomButton'
import './Button/CustomButton.css'
import {
  Dialog,
  DialogContent,
  IconButton
} from '@mui/material';
import Talents from '../components/Popup/Talents';
import CloseIcon from '@mui/icons-material/Close'; // Import CloseIcon
function Bluesy() {
  useEffect(() => {
    AOS.init({
      // Global settings for AOS
      duration: 1000, // Duration of animation in milliseconds
      easing: 'ease-in-out', // Type of easing
      once: false, // Whether the animation should occur only once
    });
  }, []);
  const [talentsModalOpen, setTalentsModalOpen] = useState(false);
  

  const handleTalentsModalOpen = () => {
    setTalentsModalOpen(true); // Open the Business modal
  };

  const handleTalentsModalClose = () => {
    setTalentsModalOpen(false); // Close the Business modal
  }; 

  const boxContainerStyle = {
    display: 'flex',
    justifyContent: 'center', // Center horizontally
    alignItems: 'center', // Center vertically
   
  };
    const boxStyle = {
        backgroundColor:'#FFE7E5',
        display: 'flex',
        justifyContent: 'center', // Center horizontally
        alignItems: 'center',
       
        maxwidth:'100%',
        height:'523px',
        borderRadius:'50px',
        
    };

    const theme = useTheme();

  const isSmallScreen = useMediaQuery('(max-width:900px)');

  return (
    <div
    data-aos="fade-up" // Example animation type ("fade-up", "fade-down", etc.)
    data-aos-duration="9000" // Override duration for this specific element
    data-aos-offset="200" // Offset (in pixels) from the original trigger point
    >
        <Box sx={{marginTop:'60px'}}>
        <div style={boxContainerStyle}>
        <Box style={boxStyle} sx={{
          width: {
            xs: "90%",
            sm: "90%",
            md: "85%",
            lg : "80%",
          }
        }}>
        <Grid container spacing={2} sx={{ maxWidth: "100%", width: "100%",  }}>
        <Grid item xs={12} sm={12} md={6}>
         
            <Box p={2} sx={{  marginLeft: {
                    xs: "5px",
                    sm: "10px",
                    md: "20px",
                    lg: "40px",
                  },}}>
              <Typography
                variant="h6"
                gutterBottom
                sx={{
                  color: "black",
                  fontFamily: "Outfit",
                  fontSize: {
                    xs: "34px",
                    sm: "34px",
                    md: "34px",
                    lg: "64px",
                  },
                  textAlign: {
                    xs: "center",
                    sm: "center",
                    md: "left",
                    lg: "left",
                  },
                  width : {
                    xs : "100%",
                    sm : "100%",
                    md : "50%",
                    lg: "70%",
                  }, 
                  fontWeight: "400",
                 
                  maxWidth: "100%",
                  lineHeight: "103%",
                  
                }}
              >
               Join as a 
Talent{" "}
              </Typography>
              <Typography
                sx={{
                  color: "black",
                  fontFamily: "Outfit",
                  fontSize: {
                    xs: "14px",
                    sm: "14px",
                    md: "14px",
                    lg: "20px",
                  },
                  textAlign: {
                    xs: "center",
                    sm: "center",
                    md: "left",
                    lg: "left",
                  },
                  fontStyle: "normal",
                  fontWeight: "400",
                  lineHeight: "30px",
                }}
              >
               Build and manage winning teams, scale your organization faster with Colonees AI solutions and pool of global talents.
              </Typography><br></br>
              {!isSmallScreen && (
              <Box sx={{maxWidth:'100%', width:'100%'}}>
              <CustomButton onClick={handleTalentsModalOpen} text="Join waitliist" fontSize="14px" width="30%" height="50px">
                Join waitlist
              </CustomButton>
              </Box>)}
              {isSmallScreen && (
              <Box sx={{maxWidth:'100%', width:'100%', display: 'flex', justifyContent: 'center' }}>
              <CustomButton onClick={handleTalentsModalOpen} text="Join waitliist" fontSize="14px" width="40%" height="50px">
                Join waitlist
              </CustomButton>
              </Box>)}
            </Box>
          
        </Grid>
        <Grid item xs={12} sm={12} md={6}>
          <Box
            display="flex"
            flexDirection="row"
            sx={{ maxWidth: "100%", width: "100%", marginLeft:"8px" }}
            data-aos="zoom-in"
            data-aos-duration="1000"
            data-aos-delay="1000"
          >
             <img
            src={frame22}
            alt="Groups"
            style={{ width: "100%", maxWidth: "100%" }}
          />
          </Box>
        </Grid>
      </Grid>
        </Box>    
        </div>
       
        </Box>
        <Box sx={{ maxWidth: '100%', width: '100%' }}>
        <Dialog open={talentsModalOpen} onClose={handleTalentsModalClose} sx={{ maxWidth: '100vw' }}>
          <DialogContent sx={{ marginTop: '10px',backgroundColor:'#F6F6F6', }}>
            {/* Render the Talents component inside the modal */}
            <Talents />
            <IconButton
              edge="end"
              color="inherit"
              onClick={handleTalentsModalClose}
              aria-label="close"
              sx={{
                position: 'absolute',
                top: 5,
                right: 20,
              }}
            >
              <CloseIcon />
            </IconButton>
          </DialogContent>
        </Dialog>
      </Box>
    </div>
  )
}

export default Bluesy
